import React from 'react';
import styled from "styled-components";
import Navbar from './NavBar';

const Container = styled.div`
  width:100%;

`;

const Yugi = () => {
    return (
    <Container>
        <Navbar />
        <h1>Yugi Page</h1>
    </Container>
  );
};

export default Yugi;
